import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/features">Features</Link>
        </li>
        <li>
          <Link to="/safety">Safety</Link>
        </li>
        <li>
          <Link to="/compatibility">Compatibility</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
